import { useCallback } from 'react';
import './IniciarSesion.css'; // Estilos específicos
import muñecosImage from './Imagenmuñecos.png'; 

const IniciarSecion = () => {
    const onBotonContainerClick = useCallback(() => {
        // Agrega tu código aquí
    }, []);

    return (
        <div className="iniciarsecion">
            <div className="content-container">
                <div className="sing-in">
                    <h2 className="iniciar-secin">Iniciar sesión</h2>
                    <div className="input-group">
                        <label className="correo-celular" htmlFor="numero">Número de celular</label>
                        <input type="text" id="numero" className="escribirlo" />
                    </div>
                    <div className="input-group">
                        <label className="correo-celular" htmlFor="contraseña">Contraseña</label>
                        <input type="password" id="contraseña" className="escribirlo" />
                    </div>
                    <button className="boton" onClick={onBotonContainerClick}>
                        Iniciar Sesión
                    </button>
                    <div className="cuadro-inner">
                        <div className="tienes-cuenta" onClick={onBotonContainerClick}>
                            <span>¿No tienes una cuenta? Registrarse coder/Crafter</span>
                        </div>
                    </div>
                </div>
                <img className="imagenmuecos-icon" alt="Muñecos" src={muñecosImage} />
            </div>
        </div>
    );
};

export default IniciarSecion;
